import style from "./About.module.css";
const About = () => {
  return (
    <div className={style.ContainerAbout}>
      <p>
        {" "}
        ¡Hola! ¿Cómo estás? Mi nombre es Jose Pergasere y estoy emocionado de
        presentarte mi primer proyecto. Quiero compartir contigo un poco más
        sobre él. Mi proyecto es una aplicación web que tiene como objetivo
        [breve descripción del propósito de la aplicación]. He estado trabajando
        arduamente en este proyecto durante [mencionar el tiempo que has
        dedicado] y estoy orgulloso del resultado hasta ahora. La idea detrás de
        mi proyecto surgió de [explicar la inspiración o la necesidad que llevó
        a la creación de la aplicación]. He invertido mucho tiempo y esfuerzo en
        el desarrollo de la aplicación, asegurándome de que sea fácil de usar,
        intuitiva y con características que sean útiles para los usuarios. Uno
        de los aspectos más emocionantes de este proyecto ha sido el proceso de
        aprendizaje y crecimiento que he experimentado en el camino. He
        adquirido nuevas habilidades técnicas, he enfrentado desafíos y he
        aprendido lecciones valiosas que me han ayudado a mejorar como
        desarrollador. Estoy emocionado de compartir mi proyecto contigo y
        espero que encuentres su funcionalidad y diseño interesantes. ¡Gracias
        por acompañarme en esta aventura y espero seguir mejorando y ampliando
        mi proyecto en el futuro! Si tienes alguna pregunta o comentario, estaré
        encantado de escucharlos. ¡Gracias por tu apoyo! ¡Saludos! Jose
        Pergasere.{" "}
      </p>
    </div>
  );
};

export default About;
